import axios from 'axios'

function fn(trackPromise, apiUrl, token, setFn) {
  const instance = axios.create({
    baseURL: apiUrl,
    headers: { Authorization: `Token ${token}` },
  });

  trackPromise(
    instance.get().then((resp) => {
      const data = resp.data;
      setFn(data);
      console.log(resp.data);
    })
  );
}

export default fn
